  lineItems: {
    edges: [
      {
        node: {
          artwork: {
            pickup_available: true,
            artist_names: "Lisa Breslow",
            title: "Gramercy Park South",
            date: "2016",
            shippingOrigin: "New York, NY",
            medium: "Oil and pencil on panel",
            dimensions: {
              in: "36 × 36 in",
